import styles from './styles.scss'

import Icon from './Icon'

const iconPaths = [
  '首页',
  '分类',
  '购物车',
  '我的'
]


export default () => {

return <div className={styles.bottom}>
{iconPaths.forEach(path => <Icon key={path} path={path}/>)}
</div>
}
